import React, { Component } from 'react';
import '../App.css';
import { Container, Row, Col } from 'reactstrap';
import TableHeader from './TableHeader';


class CycleA extends Component {
    render() {
        let weight = this.props.weight;
        let toggle = {display: this.props.isToggle? 'block' : 'none'}
        let rowCollapse; 
        if (this.props.isToggle) {
            rowCollapse = "row"
        } else {
            rowCollapse = "Row-Collapse"
        }
        function round(num) {
            return Math.round(num*2)/2;
        }

        return (
            <div className='Cycle'>
                <Container className='Table'>
                    <TableHeader />
                            <Row className={rowCollapse}>
                                <Col style={toggle}>A</Col>
                                <Col style={toggle}>40</Col>
                                <Col style={toggle}>5</Col>
                                <Col style={toggle}>{(round(weight*4/10)).toFixed(1)}</Col>                                                                
                            </Row>
                            <Row className={rowCollapse}>
                                <Col style={toggle}>B</Col>
                                <Col style={toggle}>50</Col>
                                <Col style={toggle}>5</Col>
                                <Col style={toggle}>{(round(weight*5/10)).toFixed(1)}</Col>
                            </Row>
                            <Row className={rowCollapse}>
                              <Col style={toggle}>C</Col>
                              <Col style={toggle}>60</Col>
                              <Col style={toggle}>3</Col>
                              <Col style={toggle}>{(round(weight*6/10)).toFixed(1)}</Col>
                            </Row>
                        <Row className="row">
                            <Col>1</Col>
                            <Col>65</Col>
                            <Col>5</Col>
                            <Col>{(round(weight*65/100)).toFixed(1)}</Col>
                        </Row>
                        <Row className="row">
                            <Col>2</Col>
                            <Col>75</Col>
                            <Col>5</Col>
                            <Col>{(round(weight*75/100)).toFixed(1)}</Col>
                        </Row>
                        <Row className="row">
                            <Col>3</Col>
                            <Col>85</Col>
                            <Col>5+</Col>
                            <Col>{(round(weight*85/100)).toFixed(1)}</Col>
                        </Row>
                </Container>
            </div>
            )
    }
}

export default CycleA;
